import ExpenseItem from './ExpenseItem';

function ExpenseList(props) {
    console.log(props);
    return (
        <div className='expenses'>
            {
            props.data.map((expense) => {
                return (
                    <ExpenseItem expense={expense}></ExpenseItem>
                )
            })
            }
        </div>
    )
}

export default ExpenseList;
